  false,\n\t\"url\": null,\n\t\"notes\": \"This digital elevation model (DEM) is a
  part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
  Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
  The DEMs created for this project were developed using the NOAA National Weather
  Service's Weather Forecast Office (WFO) boundaries. Because the WFO boundaries can
  cover large areas, the WFO DEM was divided into smaller DEMs to ensure more manageable
  file sizes. The Melbourne (FL) WFO DEM was split into two smaller DEMs. They are
  divided along county lines and are: 1. Melbourne (FL) WFO - Brevard and Volusia
  Counties 2. Melbourne (FL) WFO - Indian River, St. Lucie, and Martin Counties This
  metadata record describes the DEM for Miami (FL) WFO - Indian River, St. Lucie,
  and Martin Counties. The DEM includes the best available lidar data known to exist
  at the time of DEM creation for the coastal areas of Indian River, St. Lucie, and
  Martin counties, that met project specifications. The DEM is derived from LiDAR
  datasets collected for the Florida Department of Emergency Management (FDEM). LiDAR
  data for Indian River, St. Lucie and Martin counties was collected in 2007. Hydrographic
  breaklines used in the creation of the DEM were obtained from FDEM. The DEMs are
  hydro flattened such that water elevations are less than or equal to 0 meters. The
  DEM is referenced vertically to the North American Vertical Datum of 1988 (NAVD88)
  with vertical units of meters and horizontally to the North American Datum of 1983
  (NAD83). The resolution of the DEM is approximately 5 meters.\",\n\t\"owner_org\":
